import React from 'react';
import DashboardBody from "./DashboardBody";
import { Tab } from 'semantic-ui-react';
import './Main.css';

class Main extends React.Component {

    render() {
        const panes = [
            { menuItem: 'Tab 1', render: () => <Tab.Pane><DashboardBody/></Tab.Pane> },
            { menuItem: 'Tab 2', render: () => <Tab.Pane><DashboardBody/></Tab.Pane> },
            { menuItem: 'Tab 3', render: () => <Tab.Pane><DashboardBody/></Tab.Pane> },
        ]
        return (
            <div >
                <Tab menu={{ fluid: true, vertical: true, tabular: 'right' }} panes={panes} />
            </div>
        );
    }
}

export default Main;
